import React, { Component } from 'react';
import { Link } from 'react-router-dom'

class HistorySummary extends Component {
    state = {}
    handleClick = (e) => {
        console.log('id=', this.props.historyData)
    }
    render() {
        return (<React-fragment>
            {this.props.historyData.id === this.props.auth.uid && <div style={{ overflow: 'auto' }}>
                <Link to={'/'}>
                    <span>{this.props.historyData.method} </span>
                </Link>
                <span>{this.props.historyData.url}</span>
                <button style={{ color: 'red' }} onClick={() => this.handleClick(this)} >X</button>
            </div>}

        </React-fragment>);
    }
}

export default HistorySummary
